{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyMDtOyyOfChmuGEzhI+u2/R"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":1,"metadata":{"id":"kJieDJvI71EA","executionInfo":{"status":"ok","timestamp":1734192650573,"user_tz":-120,"elapsed":9969,"user":{"displayName":"Wordy","userId":"17957092315917252149"}}},"outputs":[],"source":["import numpy as np\n","import matplotlib.pyplot as plt\n","from sklearn.linear_model import LinearRegression\n","from sklearn.preprocessing import PolynomialFeatures\n","from sklearn.metrics import mean_squared_error, r2_score"]},{"cell_type":"code","source":["# Генерація випадкових даних\n","m = 100\n","X = 6 * np.random.rand(m, 1) - 4\n","y = 0.5 * X ** 2 + X + 2 + np.random.randn(m, 1)\n","\n","# Виведення графіка даних\n","plt.scatter(X, y, color='blue', label='Data')\n","\n","# Лінійна регресія\n","linear_regressor = LinearRegression()\n","linear_regressor.fit(X, y)\n","y_pred_linear = linear_regressor.predict(X)\n","\n","# Побудова лінійної регресії на графіку\n","plt.plot(X, y_pred_linear, color='red', label='Linear Regression')\n","\n","# Поліноміальна регресія (степінь 2)\n","poly_features = PolynomialFeatures(degree=2, include_bias=False)\n","X_poly = poly_features.fit_transform(X)\n","\n","# Лінійна регресія для поліноміальних даних\n","poly_regressor = LinearRegression()\n","poly_regressor.fit(X_poly, y)\n","y_pred_poly = poly_regressor.predict(X_poly)\n","\n","# Побудова поліноміальної регресії на графіку\n","X_sorted = np.sort(X, axis=0)  # Для рівномірного побудови графіка\n","X_poly_sorted = poly_features.transform(X_sorted)\n","y_pred_poly_sorted = poly_regressor.predict(X_poly_sorted)\n","\n","plt.plot(X_sorted, y_pred_poly_sorted, color='green', label='Polynomial Regression')\n","\n","# Виведення графіка\n","plt.xlabel('X')\n","plt.ylabel('y')\n","plt.title('Linear and Polynomial Regression')\n","plt.legend()\n","plt.show()\n","\n","# Виведення коефіцієнтів\n","print(f\"Linear regression coefficients: {linear_regressor.coef_}\")\n","print(f\"Polynomial regression coefficients: {poly_regressor.coef_}\")\n","print(f\"Polynomial regression intercept: {poly_regressor.intercept_}\")\n","\n","# Оцінка якості моделей\n","mse_linear = mean_squared_error(y, y_pred_linear)\n","r2_linear = r2_score(y, y_pred_linear)\n","mse_poly = mean_squared_error(y, y_pred_poly)\n","r2_poly = r2_score(y, y_pred_poly)\n","\n","print(f\"Linear regression MSE: {mse_linear}\")\n","print(f\"Linear regression R2: {r2_linear}\")\n","print(f\"Polynomial regression MSE: {mse_poly}\")\n","print(f\"Polynomial regression R2: {r2_poly}\")\n"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":594},"id":"325pNW8z8fiS","executionInfo":{"status":"ok","timestamp":1734192798626,"user_tz":-120,"elapsed":1076,"user":{"displayName":"Wordy","userId":"17957092315917252149"}},"outputId":"921254db-9dce-4818-dc8e-4395c195fda3"},"execution_count":12,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}},{"output_type":"stream","name":"stdout","text":["Linear regression coefficients: [[-0.0398381]]\n","Polynomial regression coefficients: [[1.05600439 0.49496748]]\n","Polynomial regression intercept: [2.05991164]\n","Linear regression MSE: 3.01943486370184\n","Linear regression R2: 0.001734070316423919\n","Polynomial regression MSE: 1.2383369459991442\n","Polynomial regression R2: 0.5905890875407783\n"]}]}]}